export default (function(a,b,c,d,e,f,g){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:c,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:c,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:c,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},fQc7TjolC1:{data:{id:2712,attributes:{imdbId:"tt7657566",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNjI4ZTQ1OTYtNTI0Yi00M2EyLThiNjMtMzk1MmZlOWMyMDQwXkEyXkFqcGdeQXVyMTEyMjM2NDc2._V1_SX300.jpg",type:c,ratings:[{Source:"Internet Movie Database",Value:"6.7\u002F10"},{Source:"Rotten Tomatoes",Value:"63%"},{Source:"Metacritic",Value:"53\u002F100"}],item_lang:{data:{id:3378,attributes:{title:a,plot:"Belgian sleuth Hercule Poirot's vacation aboard a glamorous river steamer turns into a terrifying search for a murderer when a picture-perfect couple's idyllic honeymoon is tragically cut short. Set against an epic landscape of sweeping Egyptian desert vistas and the majestic Giza pyramids, this tale of unbridled passion and incapacitating jealousy features a cosmopolitan group of impeccably dressed travelers, and enough wicked twists and turns to leave audiences guessing until the final, shocking denouement.",slug:"death-on-the-nile"}}},books:{data:[{id:12919,attributes:{title:a,description:"SOON TO BE A MAJOR MOTION PICTURE RELEASING OCTOBER 9, 2020 --DIRECTED BY AND STARRING KENNETH BRANAGH Following the success of Murder on the Orient Express, Kenneth Branagh returns to direct and star in this adaptation of the classic Hercule Poirot mystery for the big screen, also starring Gal Gadot. Beloved detective Hercule Poirot embarks on a journey to Egypt in one of Agatha Christie's most famous mysteries, Death on the Nile. The tranquility of a cruise along the Nile was shattered by the discovery that Linnet Ridgeway had been shot through the head. She was young, stylish, and beautiful. A girl who had everything . . . until she lost her life. Hercule Poirot recalled an earlier outburst by a fellow passenger: \"I'd like to put my dear little pistol against her head and just press the trigger.\" Yet in this exotic setting nothing is ever quite what it seems.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=SMwrywEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:true,published:"2020-09-29",publisher:"William Morrow Paperbacks",subtitle:"A Hercule Poirot Mystery"}},{id:12920,attributes:{title:a,description:"CRIME & MYSTERY FICTION. GRAPHIC NOVEL. The tranquillity of a cruise along the Nile is shattered by the discovery that Linnet Ridgeway has been shot through the head. She was young, stylish and beautiful, a girl who had everything - until she lost her life. Hercule Poirot recalls an earlier outburst by a fellow passenger: 'I'd like to put my dear little pistol against her head and just press the trigger.' Yet in this exotic setting' nothing is ever quite what it seems.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=s8bB6FiVaC0C&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["François Rivière",b,"Solidor"],firstBook:d,published:"2007-01-01",publisher:"HarperCollins UK",subtitle:e}},{id:12921,attributes:{title:a,description:"Poirot takes a vacation on a cruise on the Nile, but has an uneasy feeling that something is dangerously amiss.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=4IEpZhnfVH0C&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"1992-01-01",publisher:"HarperCollins Publishers",subtitle:e}},{id:12922,attributes:{title:a,description:"“A top-notch literary brainteaser.” –New York Times Soon to be a major motion picture sequel to Murder on the Orient Express with a screenplay by Michael Green, directed by and starring Kenneth Branagh alongside Gal Gadot—coming February 11, 2022! Beloved detective Hercule Poirot embarks on a journey to Egypt in one of Agatha Christie’s most famous mysteries. The tranquility of a luxury cruise along the Nile was shattered by the discovery that Linnet Ridgeway had been shot through the head. She was young, stylish, and beautiful. A girl who had everything . . . until she lost her life. Hercule Poirot recalled an earlier outburst by a fellow passenger: “I’d like to put my dear little pistol against her head and just press the trigger.” Yet under the searing heat of the Egyptian sun, nothing is ever quite what it seems. A sweeping mystery of love, jealousy, and betrayal, Death on the Nile is one of Christie’s most legendary and timeless works. “Death on the Nile is perfect.” —The Guardian “One of her best. . . . First rate entertainment.” —Kirkus Reviews",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=PKp5GVhRKPgC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:d,published:"2005-07-05",publisher:"Harper Collins",subtitle:"Hercule Poirot Investigates"}},{id:12923,attributes:{title:a,description:"Kriminalroman. Under en udflugtstur på Nilen bliver en rig ung kvinde myrdet, og Hercule Poirot, der også er med på turen, opdager hurtigt, at næsten alle ombord har et motiv",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=tLjyAAAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"1990-01-01",publisher:"HarperCollins",subtitle:e}}]}}},meta:{}}},prerenderedAt:1681309105827}}("Death on the Nile","Agatha Christie","movie",null,"","series",1))